import React from 'react'
import './Room.css'
import Video from './Video.js'
import Chat from './Chat.js'

function Room({ socket, name, room }) {
	return (
		<div className="room">
			<Video socket={ socket } name={ name } room={ room } />
			<Chat socket={ socket } name={ name } room={ room } />
		</div>
	)
}

export default Room
